import React from "react";
import Button from "react-bootstrap";

export default function SingleUser(props) {
  return (
    <tr>
      <td>{props.user.id}</td>
      <td>{props.user.name}</td>
      <td>{props.user.username}</td>
      <td>{props.user.website}</td>
      <td>
        <div>
          <Button>Edit</Button>
          <Button>Delete</Button>
        </div>
      </td>
    </tr>
  );
}
